ytcenter.utils.each = function(obj, callback){
  if (ytcenter.utils.isArray(obj)) {
    for (var i = 0; i < obj.length; i++) {
      if (callback(i, obj[i]) === true) break;
    }
  } else {
    for (var key in obj) {
      if (obj.hasOwnProperty(key)) {
        if (callback(key, obj[key]) === true) break;
      }
    }
  }
};
