ytcenter.utils.getRGB = function(h, s, v){
  h = h/360 * 6;
  s = s/100;
  v = v/100;

  var i = Math.floor(h),
      f = h - i,
      p = v * (1 - s),
      q = v * (1 - f * s),
      t = v * (1 - (1 - f) * s),
      mod = i % 6,
      r = [v, q, p, p, t, v][mod],
      g = [t, v, v, q, p, p][mod],
      b = [p, p, t, v, v, q][mod];

  return {red: r * 255, green: g * 255, blue: b * 255};
};
ytcenter.utils.getHSV = function(r, g, b) {
  var max = Math.max(r, g, b), min = Math.min(r, g, b);
  var h, s, v = max;

  var d = max - min;
  s = max === 0 ? 0 : d / max;

  if (max == min) {
    h = 0;
  } else {
    switch (max) {
      case r: h = (g - b) / d + (g < b ? 6 : 0); break;
      case g: h = (b - r) / d + 2; break;
      case b: h = (r - g) / d + 4; break;
    }
    h /= 6;
  }
  return {hue: h*360, saturation: s*100, value: v/255*100};
};
ytcenter.utils.hsvToHex = function(hue, sat, val){
  var rgb = ytcenter.utils.getRGB(hue, sat, val);
  return ytcenter.utils.colorToHex(rgb.red, rgb.green, rgb.blue);
};
ytcenter.utils.colorToHex = function(red, green, blue){
  red = Math.round(red);
  green = Math.round(green);
  blue = Math.round(blue);
  if (red > 255) red = 255;
  if (red < 0) red = 0;
  if (green > 255) green = 255;
  if (green < 0) green = 0;
  if (blue > 255) blue = 255;
  if (blue < 0) blue = 0;
  var r = red.toString(16);
  if (r.length === 1) r = "0" + r;
  var g = green.toString(16);
  if (g.length === 1) g = "0" + g;
  var b = blue.toString(16);
  if (b.length === 1) b = "0" + b;
  r = r.toUpperCase();
  g = g.toUpperCase();
  b = b.toUpperCase();
  return "#" + r + g + b;
};
ytcenter.utils.hexToColor = function(hex){
  if (hex.indexOf("#") === 0) hex = hex.substring(1);
  var r,g,b;
  if (hex.length === 6) {
    r = parseInt(hex.substring(0, 2), 16);
    g = parseInt(hex.substring(2, 4), 16);
    b = parseInt(hex.substring(4, 6), 16);
  } else if (hex.length === 3) {
    r = parseInt(hex.substring(0, 1) + hex.substring(0, 1), 16);
    g = parseInt(hex.substring(1, 2) + hex.substring(1, 2), 16);
    b = parseInt(hex.substring(2, 3) + hex.substring(2, 3), 16);
  } else {
    r = 0;
    g = 0;
    b = 0;
  }
  return {red: r, green: g, blue: b};
};
